import React from 'react';
import './App.css';
import Header from './components/Header';
import Hero from './components/Hero';
import Card from './components/UI/Card';
import Home from './containers/Home';

function App() {
  return (
    <div className="App">
    <Header/>
    <Hero/>
    <Card/>
      <Home/>
    </div>
  );
}

export default App;
